import * as React from 'react';
import logo from './e60c1b 1.png';
import SearchIcon from '@mui/icons-material/Search';
import Button from '@mui/material/Button';
function App(){
  const imgStyle ={
    left: "17.36%",
    right: "74.02%",
    top: "34.88%",
    bottom: "34.88%"
  }

  return (
    <>
    <div>
    <img src={logo} alt="logo" style={imgStyle}/>
    <SearchIcon/>
    <Button variant="text" color="primary" size="large">Text</Button>
    </div>
    </>
  );
}
export default App;
